import {getImageUrl} from './utils';

function Avatar({person,size}) {
  return (
    <img
      className="avatar"
      src={getImageUrl(person)}
      alt={person.name}
      width={size}
      height={size}
    />
  );
}

export default function Profile() {
  return (
    <div>
    <Avatar 
      person={{
        name: "Lin Lanying",
        image: "1bX5QH6"
      }}
      size={100}
    />
    </div>
  );
}
